  |description={{en|1=CAPE CANAVERAL, Fla. -- A Space Exploration Technologies, or SpaceX, Falcon 9 rocket lifts off Space Launch Complex 40 on Cape Canaveral Air Force Station in Florida at 10:10 a.m. EST, carrying a Dragon capsule filled with cargo. The SpaceX Dragon capsule is making its third trip to the International Space Station, following a demonstration flight in May 2012 and the first resupply mission in October 2012. The SpaceX-2 mission is the second of 12 SpaceX flights contracted by NASA to resupply the orbiting laboratory.}}
