text: |
  {{Information
  |Description={{en|1=VANDENBERG AIR FORCE BASE, Calif. – Team Vandenberg launches its first-ever SpaceX launch from Space Launch Complex-4 here Sunday, Sept. 29, 2013. 30th Space Wing's 1st Air and Space Test Squadron was the lead for all launch site certification activities at Vandenberg for SpaceX as an Evolved Expendable Launch Vehicle New Entrant. Under the authority of the Space and Missile Systems Center, the Squadron evaluated SpaceX's flight and ground systems, processes and procedures for this inaugural space launch campaign for the upgraded Falcon-9 rocket.}}
  |Source=http://www.vandenberg.af.mil/photos/media_search.asp?q=Falcon ([http://www.vandenberg.af.mil/shared/media/photodb/photos/2013%5C09%5C130929-F-ET475-012.jpg image link])
